from typing import List

def separate_paren_groups(paren_string: str) -> List[str]:
    """ This function separates the groups of parentheses in the given string and returns a list of these groups. """
    result = []
    current_group = ""
    balance = 0

    for char in paren_string:
        if char == '(':
            if balance == 0 and current_group:
                result.append(current_group)
                current_group = ""
            balance += 1
        elif char == ')':
            balance -= 1

        current_group += char

        if balance == 0 and current_group:
            result.append(current_group)
            current_group = ""

    return result

